import React from 'react'

function GridItem(props) {
    
    var count = props.count/10
    var countArray = []

    for(let i=0; i<count; i++){
        countArray[i] = i
    }
    
    const x = countArray.map((item,id)=>{
        return(<div className='item' key={id}></div>)
    })

    return (
        <div className="item">
            <h1>1</h1>
        </div>
  )
}

export default GridItem
